import React, { Component } from 'react';
import Hostel from './Hostel';
function HostelList(props){
    let products=props.products.map((product) => {
        return <Hostel url={product.url} city={product.city}  name={product.name} key={product.key} address={product.address} 
        contact={product.contact}  email={product.email} price={product.price} facilities={product.facilities}/>
    })
    return(
        <div>
            {
                {products}
            }
        </div>
    )
}
export default HostelList;
